import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse(`{"title":"§ 34-21 When householder's right to exemption is exhausted.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/34-21.md","filePath":"vacode/34-21.md"}`),r={name:"vacode/34-21.md"},h=o('<h1 id="§-34-21-when-householder-s-right-to-exemption-is-exhausted" tabindex="-1">§ 34-21 When householder&#39;s right to exemption is exhausted. <a class="header-anchor" href="#§-34-21-when-householder-s-right-to-exemption-is-exhausted" aria-label="Permalink to &quot;§ 34-21 When householder&#39;s right to exemption is exhausted.&quot;">​</a></h1><p>When an amount of property, whether real or personal, or both, has been set apart to be held by a householder as exempt under § <a href="/vacode/34-4/">34-4</a>, <a href="/vacode/34-4.1/">34-4.1</a>, or <a href="/vacode/34-13/">34-13</a>, such amount shall for a period of eight years from such setting apart be applied against the maximum amount to which the householder is entitled to set apart as exempt under § <a href="/vacode/34-4/">34-4</a>, <a href="/vacode/34-4.1/">34-4.1</a>, or <a href="/vacode/34-13/">34-13</a>.</p><p>Code 1919, § 6547; 1975, c. 466; 1977, c. 496; 1990, c. 942; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0330" target="_blank" rel="noreferrer">330</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0328" target="_blank" rel="noreferrer">328</a>.</p>',3),s=[h];function i(n,d,c,l,p,_){return a(),t("div",null,s)}const m=e(r,[["render",i]]);export{f as __pageData,m as default};
